import React from "react";
import { useState } from "react";
import Switch from "@mui/material/Switch"
import FormGroup from "@mui/material/FormGroup"
import { FormControl, FormLabel, FormControlLabel, Typography, Theme, CssBaseline, ThemeProvider } from "@mui/material";
import { makeStyles,createTheme } from '@mui/material/styles'
import {  } from '@mui/material/styles';

const Activator = () => {
    const [checked, setChecked] = useState(false)

    const handleChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        setChecked(event.target.checked)
    }
   
    const useStyles: any = makeStyles((theme: Theme) => ({
        typo: {
            textAlign: "right"
        }
    }));

    const theme = createTheme()
    const classes = useStyles();

    return (
        <>   
            <ThemeProvider theme={theme}>
            <CssBaseline/>
                <Typography variant="h2" className={classes.typo}>Service Activator</Typography>
                <FormControl sx={{marginLeft: 10}}>
                    <FormLabel focused={false}>Press to activate the service:</FormLabel>
                    <FormGroup>
                        <FormControlLabel control={<Switch checked={checked} onChange={handleChange} name="activator" color="secondary"/>} 
                            label="Activate"/>
                    </FormGroup>
                </FormControl>
            </ThemeProvider>
        </>
    )
}

export default Activator;
